import React from 'react';
import './Deep.css'; // Import your CSS file

const Deep = () => {
  return (
    
    <div className="circle-container">
      <button className="circle-btn">Button 1</button>
      <button className="circle-btn">Button 2</button>
      <button className="circle-btn">Button 3</button>
      <button className="circle-btn">Button 4</button>
      <button className="circle-btn">Button 5</button>
    </div>
  );
}

export default Deep;
